import michelangelo from "../../../images/michelangelo.jpg";
import davinci from "../../../images/davinci copy.jpg";
import donatella from "../../../images/donatella copy.jpg";

export const artists = [
    {
        id: 1,
        name: "Michelangelo",
        year: "1475-1564",
        proffesion: "Sculptor, Painter, Architect",
        image: michelangelo,
        quote: " I saw tha angel in the marble and carved until i set him free",
    },
    {
        id: 2,
        name: "Leonardo Da Vinci",
        year: "1452-1519",
        proffesion: " Mechanical Engineering, Physics, Pyrotechnics, Painter, Architect",
        image: davinci,
        quote: "The greatest deception men suffer is from their own opinions.",
    },
    {
        id: 3,
        name: "Donatello",
        year: "1386-1466",
        proffesion: "Sculptor, Painter",
        image: donatella,
        quote: "Note to you: next time, make your weapons out of high-grade titanium.",
    },
];
